(5, 1, '2018-12-11 17:59:48', '2018-12-11 16:59:48', '<label> Votre nom (obligatoire)\r\n    [text* your-name placeholder "Albert"] </label>\r\n\r\n<label> Votre adresse de messagerie (obligatoire)\r\n    [email* your-email placeholder "exemple@gmail.com"] </label>\r\n\r\n<label> Votre numéro de téléphone\r\n    [tel tel-204 placeholder "0600000000"]</label>\r\n\r\n<label> Votre message (obligatoire)\r\n    [textarea* your-message placeholder "Sujet..."] </label>\r\n\r\n[submit "Envoyer"]\n1\nRepactu: L\'actu de la bouffe "[your-subject]"\n[your-name] <jessy.fouace62@gmail.com>\njessy.fouace62@gmail.com\nDe : [your-name] <[your-email]>\r\nObjet : [your-subject]\r\n\r\nCorps du message :\r\n[your-message]\r\n\r\n-- \r\nCet e-mail a été envoyé via le formulaire de contact de Repactu: L&#039;actu de la bouffe (http://localhost/wordpress)\nReply-To: [your-email]\n\n\n\n\nRepactu: L\'actu de la bouffe "[your-subject]"\nRepactu: L\'actu de la bouffe <jessy.fouace62@gmail.com>\n[your-email]\nCorps du message :\r\n[your-message]\r\n\r\n-- \r\nCet e-mail a été envoyé via le formulaire de contact de Repactu: L&#039;actu de la bouffe (http://localhost/wordpress)\nReply-To: jessy.fouace62@gmail.com\n\n\n\nMerci pour votre message. Il a été envoyé.\nUne erreur s’est produite lors de l’envoi de votre message. Veuillez essayer à nouveau plus tard.\nUn ou plusieurs champs contiennent une erreur. Veuillez vérifier et essayer à nouveau.\nUne erreur s’est produite lors de l’envoi de votre message. Veuillez essayer à nouveau plus tard.\nVous devez accepter les termes et conditions avant d’envoyer votre message.\nCe champ est obligatoire.\nLe champ est trop long.\nLe champ est trop court.\nLe format de date est incorrect.\nLa date précède la première date autorisée.\nLa date est postérieure à la dernière date autorisée.\nUne erreur inconnue s’est produite lors du téléversement du fichier.\nVous n’avez pas les droits nécessaires pour téléverser ce type de fichier.\nLe fichier est trop volumineux.\nUne erreur s’est produite lors du téléversement du fichier.\nLe format du nombre est invalide.\nLe nombre est plus petit que le minimum autorisé.\nLe nombre est plus grand que le maximum autorisé.\nLa réponse à la question est incorrecte.\nLe code entré est incorrect.\nL’adresse e-mail n’est pas valide.\nL’URL n’est pas valide.\nLe numéro de téléphone n’est pas valide.', 'Formulaire de contact 1', '', 'publish', 'closed', 'closed', '', 'formulaire-de-contact-1', '', '', '2018-12-11 18:23:48', '2018-12-11 17:23:48', '', 0, 'http://localhost/wordpress/?post_type=wpcf7_contact_form&#038;p=5', 0, 'wpcf7_contact_form', '', 0),
